import './App.css';
import colors from './Data/ColorData';
import React from 'react';

class App extends React.Component {
  render() {

    return (
      <div>
        <h1> Color List</h1>
        <input></input>
        <hr />
        <ul>
          {colors.map((element => {
            return (
              <li key={element.hex}>
                <div style={{ backgroundColor: element.hex }} className="color-display"></div>
                {element.name}</li>
            )
          }))}
        </ul>
      </div >
    );
  }

}

export default App;
